We'll fight as hard as we can but all things considered;

1. Apparently #Sua is powering through an injured rib-side/upper mid section.

2. #Handong made it clear that she misses her family and wants a break back to China once the EU leg of the tour is done.

@OVCM_LKY @IuliiaMendel US has given the best help, no one has done so much as US has!

But right now Government is withholding weapons and trying to force Zelenskyy to negotiate. Sullivan came to Kyiv, now Milley spoke.

They can't be afraid of the nuclear bluff. It's politics, taming Russia &amp; China?
